import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

function Listings(props) {
  return (
    <>
    <p>{props.header}</p>
    <ul>
    {props.langList.map(l => <li><p>{l}</p></li>)}
    </ul>
    </>
  );
}

export default Listings;
